import styled from 'styled-components'
import {
    TwitterOutlined,
} from '@ant-design/icons';
const Component = styled.div`
display:grid;

`
export default function UserAccounts({
    name,account,accountId
}) {
    return (
        <Component>
        <TwitterOutlined/> <p> {name}</p>
        </Component>
    )
}
